    background-color: red;
`;

class MenuButton extends React.Component {
    render() {
        return (
            <ButtonStyle>
                <Icon name="user" style={{ fontSize: "30px" }}/>
            </ButtonStyle>
        );
    }
}

export default MenuButton;
